import React from 'react';


const App = () => {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/shop" element={<Shop />} />
                <Route path="/coaching" element={<Coaching />} />
            </Routes>
        </Router>
    );
}

export default App;
